                    "data": "\u4f20\u9001\u5b9d\u77f3\u53ef\u7528\u4e8e\u5c06\u73a9\u5bb6\u4f20\u9001\u5230\u5df2\u6807\u8bb0\u7684\u4f4d\u7f6e.</br></br>\u4f20\u9001\u5b9d\u77f3\u9700\u4f7f\u7528\u80fd\u91cf,\u53ef\u5728\u91ca\u80fd\u53f0\u8fdb\u884c\u5145\u80fd.\u624b\u6301\u5b9d\u77f3Shift\u53f3\u952e\u65b9\u5757,\u5c06\u4f1a\u628a\u8be5\u65b9\u5757\u94fe\u63a5\u5230\u6b64\u5b9d\u77f3.</br>\u5982\u5176tooltip\u6240\u793a,\u5b9d\u77f3\u672c\u8eab\u7684\u72b6\u6001\u5c06\u5207\u6362\u4e3a\"\u5df2\u94fe\u63a5\".</br>\u94fe\u63a5\u540e,\u73a9\u5bb6\u53ef\u4ee5\u6d88\u8017\u5b9d\u77f3\u4e2d\u5b58\u50a8\u7684\u4e00\u4e9b\u80fd\u91cf,\u624b\u6301\u4f20\u9001\u5b9d\u77f3\u53f3\u952e,\u5373\u53ef\u4f20\u9001\u81f3\u94fe\u63a5\u7684\u65b9\u5757.</br></br>\u6309\u4e0bF3+H\u53ef\u542f\u7528\u7269\u54c1\u7684\u8be6\u7ec6tooltip,\u53ef\u663e\u793a\u94fe\u63a5\u4f4d\u7f6e\u7684\u786e\u5207\u5750\u6807\u548c\u7ef4\u5ea6.</br></br>\u5f53\u4f20\u9001\u5b9d\u77f3\u5185\u7684\u80fd\u91cf\u4f4e\u4e8e44\uff05\u65f6,\u8d1f\u9762\u5f71\u54cd\u5c06\u4f1a\u51fa\u73b0:</br></br>\u504f\u79fb-\u73a9\u5bb6\u5c06\u88ab\u4f20\u9001\u5230\u968f\u673a\u4f4d\u7f6e\u800c\u4e0d\u662f\u94fe\u63a5\u7684\u65b9\u5757.</br>\u5404\u79cd\u8d1f\u9762\u836f\u6c34\u6548\u679c-\u80fd\u91cf\u8d8a\u4f4e,\u6548\u679c\u6301\u7eed\u65f6\u95f4\u8d8a\u957f:</br></br>\u7f13\u6162-II</br>\u53cd\u80c3-I</br>\u865a\u5f31-II</br>\u9965\u997f-I</br>\u672b\u5f71\u4eba-\u751f\u6210\u6124\u6012\u7684\u672b\u5f71\u4eba\u5e76\u653b\u51fb\u73a9\u5bb6.</br>\u7269\u54c1\u6389\u843d-\u73a9\u5bb6\u7269\u54c1\u680f\u4e2d\u7684\u968f\u673a\u7269\u54c1\u4f1a\u6389\u843d.</br>\u98ce\u66b4-\u4f1a\u9020\u62102-3\u5206\u949f\u7684\u96f7\u96e8.\u8fd9\u662f\u6700\u7f55\u89c1\u7684\u6548\u679c.",
