                    "x": 12.0,
                    "y": 156.0,
                    "data": "\u5f3a\u5316TNT\u662f\u539f\u7248TNT\u7684\u7279\u6b8a\u7248\u672c,\u5177\u6709\u4e00\u4e2a\u6216\u591a\u4e2a\u7279\u6b8a\u6548\u679c(\u5f3a\u5316).</br></br>\u60f3\u8981\u5f3a\u5316\u4f60\u7684TNT,\u624b\u6301\u672b\u5f71\u7c89\u672b\u53f3\u952e\u5b83.\u8fd9\u79cd\u5f3a\u5316\u6548\u679c\u7684\u91cd\u8981\u7279\u5f81\u662f\u53ef\u5806\u53e0,\u8fd9\u610f\u5473\u7740\u4f60\u53ef\u4ee5\u6839\u636e\u9700\u8981\u7ee7\u7eed\u5411\u4e00\u4e2aTNT\u6dfb\u52a0\u5c3d\u53ef\u80fd\u591a\u7684\u5f3a\u5316\u6548\u679c.</br></br>\u5f3a\u5316:</br>\u4e0d\u7834\u574f\u65b9\u5757(\u7fbd\u6bdb)</br>TNT\u7206\u70b8\u65f6\u4e0d\u7834\u574f\u65b9\u5757.</br></br>\u65e0\u5b9e\u4f53\u4f24\u5bb3(\u7c98\u6db2\u7403)</br>TNT\u7206\u70b8\u65f6\u65e0\u5b9e\u4f53\u4f24\u5bb3.</br></br>\u989d\u5916\u4f24\u5bb3(\u706b\u836f)</br>TNT\u7206\u70b8\u65f6\u9020\u6210\u989d\u5916\u4f24\u5bb3.</br></br>\u9677\u9631(\u7ea2\u77f3)</br>\u5f53\u654c\u5bf9\u7684\u602a\u7269\u78b0\u5230\u6216\u8e29\u5230TNT\u65b9\u5757\u65f6,TNT\u7206\u70b8.</br></br>\u4e0d\u88ab\u963b\u6321(\u672b\u5f71\u73cd\u73e0)</br>TNT\u53ef\u4ee5\u7a7f\u8fc7\u56fa\u4f53\u65b9\u5757\u5e76\u5728\u51e0\u79d2\u949f\u540e\u7206\u70b8.</br></br>\u706b\u7130(\u706b\u6210\u5ca9)</br>TNT\u7206\u70b8\u4f1a\u5f15\u53d1\u5927\u706b.</br></br>\u65e0\u5ef6\u65f6(\u7ea2\u77f3\u706b\u628a)</br>TNT\u7acb\u5373\u7206\u70b8.",
