                    "symbolSize": 37,
                    "symbol": "image://version/272/quests_icons/QuestIcon/2363.png",
                    "x": 300.0,
                    "y": 108.0,
                    "data": "\u7a7a\u95f4\u78b0\u649e\u5b9d\u77f3\u53ef\u7528\u4e8e\u8fdb\u884c\u7c7b\u4f3c\u672b\u5f71\u73cd\u73e0\u7684\u4f20\u9001.</br></br>\u7a7a\u95f4\u78b0\u649e\u5b9d\u77f3\u9700\u4f7f\u7528\u80fd\u91cf,\u53ef\u5728\u91ca\u80fd\u53f0\u8fdb\u884c\u5145\u80fd.\u624b\u6301\u5b9d\u77f3\u53f3\u952e,\u5c06\u4f1a\u5411\u73a9\u5bb6\u7784\u51c6\u7684\u4f4d\u7f6e\u53d1\u5c04\u7d2b\u8272\u7c92\u5b50\u675f.\u5f53\u7c92\u5b50\u675f\u78b0\u5230\u65b9\u5757\u65f6,\u73a9\u5bb6\u5c06\u88ab\u4f20\u9001\u5230\u8be5\u65b9\u5757\u4e0a.\u6c34\u5e73\u7684\u6700\u5927\u4f20\u9001\u8ddd\u79bb\u4e3a75\u683c.\u4e0e\u672b\u5f71\u73cd\u73e0\u4e0d\u540c,\u4f20\u9001\u4e0d\u4f1a\u4f24\u5bb3\u73a9\u5bb6.</br></br>\u5373\u4f7f\u7c92\u5b50\u675f\u78b0\u5230\u7684\u662f\u65b9\u5757\u7684\u4fa7\u9762\u6216\u5e95\u90e8,\u7a7a\u95f4\u78b0\u649e\u5b9d\u77f3\u8fd8\u662f\u4f1a\u5c1d\u8bd5\u5c06\u73a9\u5bb6\u4f20\u9001\u5230\u65b9\u5757\u7684\u9876\u90e8.</br></br>\u7a7a\u95f4\u78b0\u649e\u5b9d\u77f3\u53ef\u5c06\u73a9\u5bb6\u4f20\u9001\u7a7f\u8fc7\u8fde\u7eed7\u4e2a\u56fa\u4f53\u65b9\u5757,\u8fd9\u4f7f\u5b9d\u77f3\u4f20\u9001\u6210\u4e3a\u901a\u8fc7\u6d1e\u7a74\u58c1\u6216\u5929\u82b1\u677f\u7684\u597d\u65b9\u6cd5.\u5982\u679c\u5899\u539a\u8d85\u8fc77\u683c,\u5b9d\u77f3\u5c31\u4f1a\u5c1d\u8bd5\u5728\u5899\u5185\u627e\u52302\u683c\u7a7a\u6c14\u65b9\u5757.\u5982\u679c\u627e\u4e0d\u5230\u8fd9\u6837\u7684\u7a7a\u6c14\u65b9\u5757,\u73a9\u5bb6\u5c06\u88ab\u4f20\u9001\u5230\u5899\u91cc\u5bfc\u81f4\u7a92\u606f.</br></br>\u6740\u6b7b\u672b\u5f71\u4e4b\u773c\u5c0fboss\u65f6\u53ef\u80fd\u4f1a\u6389\u843d\u7a7a\u95f4\u78b0\u649e\u5b9d\u77f3.",
