                    "x": 12.0,
                    "y": 108.0,
                    "data": "\u8fd9\u79cd\u7d2b\u8272\u7684\u82b1\u751f\u957f\u5728\u672b\u5730\u5c0f\u5c9b\u7684\u6700\u9ad8\u5904.\u53ef\u4ee5\u79cd\u690d\u5728\u672b\u5730\u77f3\u3001\u6ce5\u571f\u3001\u8349\u65b9\u5757\u4e0a.\u4e5f\u53ef\u4ee5\u79cd\u690d\u5728\u82b1\u76c6\u4e2d.</br></br>\u5728\u672b\u5730\u5916,\u5373\u4f7f\u5728\u82b1\u76c6\u4e2d,\u82b1\u4e5f\u4f1a\u6162\u6162\u8150\u70c2.</br></br>\u7ecf\u8fc7\u4e00\u6bb5\u65f6\u95f4\u7684\u67af\u840e,\u5b83\u5f00\u59cb\u5076\u5c14\u5438\u5f15\u6124\u6012\u7684\u672b\u5f71\u4eba.</br></br>\u5f53\u82b1\u5b8c\u5168\u67af\u840e\u540e,\u5b83\u4f1a\u53d8\u9ed1\u5e76\u5bf9\u5468\u56f4\u91ca\u653e\u51fa\u51cb\u4ea1\u6548\u679c,\u4f46\u540c\u65f6\u4f1a\u751f\u6210\u80fd\u91cf\u661f\u56e2.</br></br>\u4f7f\u7528\u672b\u5f71\u7c89\u672b\u53ef\u4ee5\u90e8\u5206\u6cbb\u6108\u67af\u840e.",
