                    "y": 252.0,
                    "data": "\u51c0\u5316\u836f\u6c34\u662f\u4e00\u79cd\u53ef\u4ee5\u996e\u7528\u6216\u6295\u63b7\u7684\u836f\u6c34,\u5b83\u53ef\u4ee5\u6d88\u9664\u8bc5\u5492.</br></br>\u83b7\u53d6:</br>\u51c0\u5316\u836f\u6c34\u9700\u7528\u5916\u8d28\u548c\u7c97\u5236\u836f\u6c34\u5728\u5f3a\u5316\u917f\u9020\u53f0\u4e2d\u917f\u9020\u800c\u6210.</br></br>\u4f60\u8fd8\u53ef\u4ee5\u4f7f\u7528\u706b\u836f\u548c\u989d\u59163\u4e2a\u672b\u5f71\u7c89\u672b\u5c06\u5176\u5236\u6210\u55b7\u6e85\u578b\u836f\u6c34.",
