                    "x": 108.0,
                    "y": 108.0,
                    "data": "\u7fa4\u7cfb\u6307\u5357\u9488\u662f\u4e00\u79cd\u7279\u6b8a\u7684\u6307\u5357\u9488,\u5f53\u73a9\u5bb6\u5728\u672b\u5730\u65f6,\u5b83\u4f1a\u6307\u5411\u6700\u8fd1\u7684\u751f\u6001\u5c9b\u5c7f.</br>\u53f3\u952e\u5355\u51fb\u4f1a\u5728\u6240\u6709\u73b0\u5b58\u7fa4\u7cfb\u4e2d\u6eda\u52a8\u5207\u6362.</br></br>\u624b\u6301\u7fa4\u7cfb\u6307\u5357\u9488,\u5b83\u5c06\u628a\u6240\u6709\u9009\u5b9a\u7684\u7fa4\u7cfb\u6807\u8bb0\u5728\u5c4f\u5e55\u4e0a.</br>\u6807\u8bb0\u662f\u5e26\u6709\u9009\u5b9a\u751f\u7269\u7fa4\u7cfb\u989c\u8272\u7684\u5c0f\u65b9\u5757,\u8d8a\u9760\u8fd1\u5c9b\u5c7f,\u65b9\u5757\u4e5f\u8d8a\u5927(\u5982\u679c\u5230\u8fbe\u5c9b\u5c7f,\u6807\u8bb0\u5c31\u4f1a\u6d88\u5931,\u79bb\u5f00\u5c9b\u5c7f\u65f6\u4f1a\u518d\u6b21\u51fa\u73b0).",
